INSERT INTO `frm_letter_rule` VALUES (4, 1, '7.1.1 พนักงานต้องปฏิบัติตามระเบียบข้อบังคับ จรรยาบรรณ (Code of Conduct ) ระเบียบสัญญาจ้าง แรงงาน ประกาศ คําสั่ง นโยบาย และกฎเกณฑ์ต่างๆ ของบริษัท รวมทั้งคําสั่งอันชอบด้วยกฎหมาย และ ด้วยหน้าที่ของผู้บังคับบัญชา', '', 19);
INSERT INTO `frm_letter_rule` VALUES (5, 3, '7.1.3 พนักงานต้องแจ้งการเปลี่ยนแปลงสถานภาพของตนเองให้บริษัท ทราบในกรณีเปลี่ยนชื่อ/นามสกุล ที่อยู่ อาศัย สมรส/หย่าร้าง มีบุตร บุคคลในครอบครัวเสียชีวิต เปลี่ยนบัตรประจําตัวประชาชน ทั้งนี้ภายใน 7 วันนับจากวันที่เปลี่ยนแปลงในแต่ละกรณี', 'เตือนด้วยวาจา', 19);
INSERT INTO `frm_letter_rule` VALUES (6, 5, '7.1.5 พนักงานต้องสนใจรับทราบและปฏิบัติตามคําสั่ง นโยบาย หรือประกาศของบริษัท โดยต้องรายงานเรื่องต่างๆ ที่อาจส่งผลให้บริษัทได้รับความเสียหายให้ผู้บังคับบัญชาได้รับทราบ', 'เตือนด้วยลายลักษณ์อักษร', 19);
INSERT INTO `frm_letter_rule` VALUES (7, 3, '7.1.3 พนักงานต้องแจ้งการเปลี่ยนแปลงสถานภาพของตนเองให้บริษัท ทราบในกรณีเปลี่ยนชื่อ/นามสกุล ที่อยู่ อาศัย สมรส/หย่าร้าง มีบุตร บุคคลในครอบครัวเสียชีวิต เปลี่ยนบัตรประจําตัวประชาชน ทั้งนี้ภายใน 7 วันนับจากวันที่เปลี่ยนแปลงในแต่ละกรณี', 'เตือนด้วยวาจา', 19);

